import React from 'react';
import DynamicFieldsForm from "../../../common/DynamicFieldsForm";
import {Button, Tabs,Divider,Table,Card , Icon } from "antd";
const TabPane = Tabs.TabPane;
class Printout extends React.Component{
	constructor(props){
		super(props);
		const panes = [
	      { title: 'Tab 1', content: 'Content of Tab 1', key: '1' },
	      { title: 'Tab 2', content: 'Content of Tab 2', key: '2' },
	      {
	        title: 'Tab 3', content: 'Content of Tab 3', key: '3', closable: false,
	      },
	    ];
	}


	render(){
		return (<div>
			<Card>
				<Tabs>
					{this.state.panes.map(pane => <TabPane tab={pane.title} key={pane.key} closable={pane.closable}>{pane.content}</TabPane>)}
				</Tabs>
	            <Tabs defaultActiveKey="emr">
	              <TabPane tab={<span><Icon type="calculator" />EMR</span>} key="emr">
	              	<h4>
                        <div>
                           <Button.Group>
                                <Button type="primary"> Invoices</Button>
                                <Button type="danger"> Receipts</Button>
                            </Button.Group>
                        </div>
                    </h4>

	              </TabPane>
	              <TabPane tab={<span><Icon type="book" />BILLING</span>} key="billing">
		               	<h4>
	                        <div>
	                            <Button.Group>
	                                <Button type="primary"> Invoices</Button>
	                                <Button type="danger"> Receipts</Button>
	                            </Button.Group>
	                        </div>
	                    </h4>

	              </TabPane> 
	            </Tabs>
			</Card>
		</div>);

	}

}
export default Printout;
